              user: "sumukh",
              date: "Sun May 02 2021 10:09:06 GMT+0530",
              line: "Nice",
            },
          ],
        },
      ],
    };
  }

  render() {
    return (
      <div className="sa-home-w">
        {this.state.data.map((e, i) => {
          return <div className="eachPost"></div>;
        })}
        <div className="eachPost"></div>
      </div>
    );
  }
}

export default Home;
